INSERT INTO "public"."commodity" VALUES ('ef78851b-e492-4c89-8582-521c08d1702d', '征收集体土地林地、经济林木、用材林、花木花卉补偿标准', '药材', '乔木', '株', '300', '指单株。成片林0.5亩以上盛产12000元/亩；初产8000元/亩；幼树5000元/亩；幼苗3000元/亩。', '盛产', '1、征收集体土地所涉及的经济林木、用材林、花木花卉的补偿均为一次性补偿。2、同一片地块成片种植一种或多种经济林木、花木花卉、用材林及其他等，不按品种、数量、规格进行清点、登记，根据种植数量最多的品种计价或确定综合价进行补偿。3、盆景花木花卉不作损毁补偿。4、一年生草本药材或其它经济作物均按所在地年产值计补1720-1870元/亩。5、征地调查公告发布后抢栽、抢种的苗木不予补偿。', NULL, NULL);
